import { makeStyles } from "@material-ui/core";

export default makeStyles(() => ({
    appBar: {
      borderRadius: 15,
      margin: '30px 0',
      display: 'flex',
      flexDirection: 'row',
      justifyContent: 'center',
      alignItems: 'center',
    },
    heading: {
      color: 'rgba(10,183,255, 1)',
      border: '3px solid',
    },
    image: {
      marginLeft: '15px',
    },
  }));
